import React from 'react';

import logo from './image/img.png';

function Acceuil() {
    return (
        <div className="container info">
            <img src={logo} alt="images" /><br />
            <h2>Mohamed Diallo</h2>
            <h1>Développeur Web</h1><br />
            <p>Alternance une semaine de formation et trois semaines en entreprise</p>
            <button className="btn btn-success">Télécharger CV</button>
        </div>
    )
}

export default Acceuil;
